import axios from 'axios';
import {GET_ERRORS} from './types';
// regiser user

export const registeruser = userData => dispatch => {
     axios.post("http://localhost:3001/api/users/register", userData)
            .then((res)=> {
                console.log(res.data)
            })
            .catch((err)=> {

                dispatch({
                    type : GET_ERRORS,
                    payload : err.response.data
                })

            })

}
